import React, { Fragment } from "react";

import { LogoName } from "../logoName";
const image = "/images/giftu.png";

const Header = () => {
	return (
		<Fragment>
			<h1>Hola</h1>
			<LogoName src={image} alt="logo imagen" />
		</Fragment>
	);
};

export default Header;
